import React from 'react';

import circlePlaceholder from './Icons/circlePlaceholder.png';
import FlipCard from './Components/FlipCard.js'
import skilledIsa from './Icons/skilledIsa.png'

const ThirdPage = () => (



  <div className='third-page' id='third-page'>

    <div className='third-page-header'>
        {/* Round Button Download Resume and text */}
        <div className="third-page-div">
            <img src = {skilledIsa} alt="Placeholder" className="first-page-girl-img" />
            <h2 className='second-page-title'>SKILLS</h2>
        </div>
     </div>



    <div className='flip-cards-section-div'>
        <div className='flip-cards-div'>
            <FlipCard
                imageSrc={circlePlaceholder}
                title="Programming Languages"
                bulletPoints={[
                    "JavaScript",
                    "C#",
                    "Java",
                    "TypeScript"
                ]}
            />

            <FlipCard
                imageSrc={circlePlaceholder}
                title="Web Technologies"
                bulletPoints={[
                    "HTML",
                    "CSS",
                    "React",
                    "Knockout",
                    "RequireJS",
                    "Oracle Jet"
                ]}
            />


            <FlipCard
                imageSrc={circlePlaceholder}
                title="Game & XR Development"
                bulletPoints={[
                    "Unity",
                    "MRTK",
                    "StereoKit"
                ]}
            />

            <FlipCard
                imageSrc={circlePlaceholder}
                title="Testing & Automation"
                bulletPoints={[
                    "QUnit", 
                    "Selenium", 
                    "PowerMockito", 
                    "Karma", 
                    "Mocha"
                ]}
            />
        </div>

        <div className='flip-cards-div'>
            <FlipCard
                imageSrc={circlePlaceholder}
                title="CI/CD & Build Tools:"
                bulletPoints={[
                    "Jenkins"
                ]}
                />

            <FlipCard
                imageSrc={circlePlaceholder}
                title="Version Control:"
                bulletPoints={[
                    "Git"
                ]}
            />

            <FlipCard
                imageSrc={circlePlaceholder}
                title="Prototyping"
                bulletPoints={[
                    "Agile",
                    "JIRA",
                    "Microsoft Boards",
                    "Confluence",
                    "Notion"
                ]}
            />
            <FlipCard
                imageSrc={circlePlaceholder}
                title="Devices"
                bulletPoints={[
                    "Lenovo A3",
                    "SKU4",
                    "Motorola Edge+",
                    "Lenovo VRX",
                    "Anorak SKU2"
                ]}
            />
        </div>

    </div>




    </div>


